// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;
import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/utils/SafeERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/AddressUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/cryptography/ECDSAUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";


import "./IPancakeRouter02.sol";
import "./IUniswapV2Factory.sol";
import "./IPancakePair.sol";

contract GpcExchange is ReentrancyGuardUpgradeable{
    using SafeMathUpgradeable for uint256;
    using ECDSAUpgradeable for bytes32;
    // Events
    event RequestSubmitted(bytes32 indexed requestHash, uint256 executeAfter);
    event RequestExecuted(bytes32 indexed requestHash);
    event PaymentReceived(address indexed from,address user, uint256 amount);
    event TradeTriger(uint256 price, uint result,uint256 usdt);
    event WithdrawGpc(address indexed from,address user, uint256 amount, uint256 fee);
    event WithdrawBnb(address indexed from,address user, uint256 amount, uint256 fee);
    event Deposit(address indexed from,address user, uint256 amount);
    event Buy(uint256 bnb, uint256 amount,uint256 leftbnb,uint256 leftgpc);
    event Sell(uint256 bnb, uint256 amount,uint256 leftbnb,uint256 leftgpc);


    struct TradeRequest {
        address toAddress;
        uint256 amountMin;
        uint256 price;
        uint tradeType;
        uint256 amountIn;
        uint256 submitBlock;
        uint256 executeAfter;
        bool executed;
    }


    uint256 internal nonce;
    uint256 internal delaySeed ;


    uint256 internal constant splitBase = 50 * 10 ** 18;
    uint256 internal constant sellSplitBase = 500 * 10 ** 18;
    uint256 internal constant MIN_DELAY_BLOCKS = 1; // ~12秒
    uint256 internal constant MAX_DELAY_BLOCKS = 10; // ~2分钟
    uint256 internal constant VALIDITY_PERIOD = 80; // ~20分钟
    uint256 internal constant tradeLimit = 10 * 10 ** 18; // 10 USDT minimum trade
    address internal constant gpc_address =
        0xD3c304697f63B279cd314F92c19cDBE5E5b1631A;
    // Constants
    address internal constant usdt_address =
        0x55d398326f99059fF775485246999027B3197955;
    address internal constant wbnb_address =
        0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    address internal constant pancake_router = 0x10ED43C718714eb63d5aA57B78B54704E256024E;

    address internal  owner;
    // State variables
    IPancakeRouter02 internal uniswapV2Router;
    IPancakePair internal uniswapV2PairGpc;
    IPancakePair internal uniswapV2PairUsdt;

    uint256 public  defaultGrid;
    uint256 public  defaultSlip;
    uint256 public  tradeFee;

    uint256 internal gpcProfit;
    uint256 internal bnbProfit;

    mapping(bytes32 => TradeRequest) public pendingRequests;
    bytes32[] internal requests;

    mapping(address => uint256) internal userBalances;
    address[] internal balanceKeys;

    mapping(address => bool) private whiteList;
    mapping(address => bool) private _roles;

    address internal   profitAddress;
    address internal exeAddress;
    IERC20Upgradeable  internal gpc;

    uint256 internal gpcBalance;
    uint256 internal bnbBalance;

    uint256 internal lastReserve;

    function initialize() public initializer {
        gpc  = IERC20Upgradeable(gpc_address);
        uniswapV2Router = IPancakeRouter02(pancake_router);

        address factory = uniswapV2Router.factory();
        uniswapV2PairGpc = IPancakePair(
            IUniswapV2Factory(factory).getPair(
                gpc_address,
                uniswapV2Router.WETH()
            )
        );
        uniswapV2PairUsdt = IPancakePair(
            IUniswapV2Factory(factory).getPair(
                usdt_address,
                uniswapV2Router.WETH()
            )
        );

        (uint256 _gpcBnbAmount, uint256 _gpcAmount, ) = uniswapV2PairGpc
            .getReserves();
        lastReserve = _gpcBnbAmount.add(_gpcAmount);
        owner = msg.sender;
        __ReentrancyGuard_init(); // 初始化父合约 
        delaySeed = block.prevrandao;
        exeAddress = 0x4A0936bfAaaaa318c6BA82936562917ff523B9Ec;
        profitAddress = 0xB7924467cEce8FD55dA013d8cFe2333173c9C236;
        defaultGrid = 5;
        defaultSlip = 10;
        tradeFee = 100;
    }

     // Modifiers

    modifier antiFlashLoan() {
        uint256 prePrice = gpcPrice();
        _;
        uint256 postPrice = gpcPrice();
        require(postPrice <= (prePrice * 110) / 100, "Price manipulation");
    }

    modifier onlyAdmin(){
        require(msg.sender == profitAddress|| msg.sender ==exeAddress,'not admin' );
        _;
    }


    modifier onlyWhiteList(){
        require(whiteList[msg.sender],'not white list');
        _;
    }

    function checkWhiteList(address addr) public virtual view   returns (bool) {
        return whiteList[addr];
    }


    function setWhiteList(address addr, bool state) public virtual onlyAdmin{
        whiteList[addr] = state;
        if(!state){
            _withdraw_putong_(addr);
        }
    }

    function setParams(uint256 grid,  uint256 fee) public virtual onlyAdmin{  
        require(1 <= grid && grid <= 20, "grid shoud between 1 and 20 ");
        require(10 <= fee && fee <= 1000, "fee shoud between 10 and 1000 ");
        defaultGrid = grid;
        tradeFee = fee;
    }

    function setAddress(address _execAddress_) public virtual onlyAdmin{
        require( _execAddress_ !=address(0));
        exeAddress = _execAddress_;
    }
      function setProfitAddress(address _profitAddress_) public virtual onlyAdmin{
        require( _profitAddress_ !=address(0));
        profitAddress = _profitAddress_;
    }

    function getReserves()
        public virtual
        view
        returns (uint256, uint256, uint256, uint256)
    {
        (uint256 _gpcBnbAmount, uint256 _gpcAmount, ) = uniswapV2PairGpc
            .getReserves();
        (uint256 _usdtAmount, uint256 _usdtBnbAmount, ) = uniswapV2PairUsdt
            .getReserves();
        return (_gpcBnbAmount, _gpcAmount, _usdtAmount, _usdtBnbAmount);
    }

    function total() public virtual view returns (uint256 bnbTotal, uint256 gpcTotal,uint256 bnbReal,uint256 gpcReal) {
        bnbTotal = bnbBalance;
        gpcTotal = gpcBalance;
        bnbReal = address(this).balance;
        gpcReal = gpc.balanceOf(address(this));
    }


    function withDrawErc20(address erc20Address) external  virtual nonReentrant{
        require(erc20Address != gpc_address, "can not by gpc");
        IERC20Upgradeable cons = IERC20Upgradeable(erc20Address);
        uint256 balance = cons.balanceOf(address(this));
        SafeERC20Upgradeable.safeTransfer(cons, profitAddress, balance);
    }

    function _init_user_(address user) internal virtual {
        if (!contains(user)) {
            balanceKeys.push(user);
        }
    }

    function contains(address account) internal virtual view returns (bool) {
        for (uint256 i = 0; i < balanceKeys.length; i++) {
            if (balanceKeys[i] == account) {
                return true;
            }
        }
        return false;
    }


    function cheanSystem() public virtual  onlyAdmin {
        for (uint256 i = 0; i < balanceKeys.length; i++) {
            address user = balanceKeys[i];
            _withdraw_putong_(user);

        }
        uint256 _gpcBalance_ = gpc.balanceOf(address(this));
        if (_gpcBalance_ > 0) {
            SafeERC20Upgradeable.safeTransfer(gpc, profitAddress, _gpcBalance_);
            emit WithdrawGpc(profitAddress,profitAddress, _gpcBalance_, 0);
        }
        uint256 balance = address(this).balance;
        if (balance > 0) {
            AddressUpgradeable.sendValue(payable(profitAddress), balance);
            emit WithdrawBnb(profitAddress,profitAddress, balance, 0);
        }
    }


    function getProfit() internal virtual view returns(uint256,uint256){
        return (gpcProfit,bnbProfit);
    }


    // 主提现函数
    function _withdraw_putong_(address user) internal virtual  nonReentrant {
        (uint256 user_gpc, uint256 user_bnb) = balanceOfValue(user);
        userBalances[user] =0;
        if (user_gpc> 0) {
            gpcBalance = gpcBalance.sub(user_gpc);
            SafeERC20Upgradeable.safeTransfer(gpc, user, user_gpc);
            emit WithdrawGpc(user,user, user_gpc, 0);
        }
        if (user_bnb > 0) {
            bnbBalance = bnbBalance.sub(user_bnb);
            AddressUpgradeable.sendValue(payable(user), user_bnb);
            emit WithdrawBnb(user,user, user_bnb, 0);
        } 
    }

    //value 是对应的u的数量
    function _processDeposit_(address user, uint256 value) internal virtual nonReentrant onlyWhiteList{
        require(value >= 100* 1e18, "Minimum deposit is 100 USDT"); // 100 USDT 最低存款
        // 先算当前的净值
         (uint256 gpcValue,uint256 bnbValue)= totalBalanceValue();
         uint256 _total_ = gpcValue + bnbValue;
        uint256 _totalBalance = totalBalance();
         _init_user_(user);
        if(_totalBalance == 0){
            userBalances[user] = userBalances[user].add(value);
        }else{
            uint256 _per_ = _total_.mul(1e18).div(_totalBalance);
            uint256 userPer = value.mul(1e18).div(_per_);
            userBalances[user] = userBalances[user].add(userPer);
        }

    }

    function buy_result(uint256 bnbAmount,uint256 gpcAmount) internal virtual{
        bnbBalance = bnbBalance.sub(bnbAmount);
        gpcBalance =gpcBalance.add(gpcAmount);

        emit Buy(bnbAmount, gpcAmount,bnbBalance,gpcBalance);


    }

    function sell_result(uint256 bnbAmount,uint256 gpcAmount) internal virtual{
        bnbBalance = bnbBalance.add(bnbAmount);
        gpcBalance = gpcBalance.sub(gpcAmount); 
        emit Sell( bnbAmount, gpcAmount,bnbBalance,gpcBalance);
    }

    function requestLength() public view returns (uint256){
        return requests.length;
    }


    function _getPrice(
        uint256 reserveA,
        uint256 reserveB
    ) internal pure returns (uint256) {
        require(reserveB > 0, "Division by zero");
        return (10 ** 18 * reserveA) / reserveB;
    }

    function gpcPrice() public  virtual view returns (uint256) {
        (
            uint256 _gpcBnbAmount,
            uint256 _gpcAmount,
            uint256 _usdtAmount,
            uint256 _usdtBnbAmount
        ) = getReserves();
        require(_gpcAmount > 0 && _usdtBnbAmount > 0, "Division by zero");

        // 使用 SafeMath 优化
        uint256 numerator = _gpcBnbAmount.mul(_usdtAmount).mul(1e18);
        uint256 denominator = _gpcAmount.mul(_usdtBnbAmount);
        return numerator.div(denominator);
    }

    function bnbPrice() public virtual view returns (uint256) {
        (, , uint256 _usdtAmount, uint256 _usdtBnbAmount) = getReserves();
        require(_usdtBnbAmount > 0, "Division by zero");

        // 使用 SafeMath 优化
        uint256 numerator = _usdtAmount.mul(1e18);
        return numerator.div(_usdtBnbAmount);
    }

    function gpcBnbPrice() internal virtual view returns (uint256) {
        (uint256 _gpcBnbAmount, uint256 _gpcAmount, , ) = getReserves();
        return _getPrice(_gpcBnbAmount, _gpcAmount);
    }


    // Helper functions
    function _randomDelay() internal virtual returns (uint256) {
        delaySeed = uint256(
            keccak256(abi.encodePacked(delaySeed, block.timestamp))
        );
        return (delaySeed % (MAX_DELAY_BLOCKS - MIN_DELAY_BLOCKS + 1)) + MIN_DELAY_BLOCKS;
    }


    function checkExecute() external  virtual view returns (bool){
        bool result = false;
        for(uint256 i=0;i<requests.length;i++){
            TradeRequest storage request = pendingRequests[requests[i]];

            if(!request.executed){
                if(block.number >= request.executeAfter){          
                    result=true;
                    break;
                }
            }
        }
        return result;
    }

    function _executeTrade_(bytes32 requestHash) internal virtual {
        TradeRequest storage request = pendingRequests[requestHash];
        request.executed = true;
        if(request.executeAfter + VALIDITY_PERIOD < block.number){   
            return;
        }

        if(request.tradeType==0){
            if(request.amountIn > bnbBalance){
                return;
            }
            // 买入
            uint256 before = address(this).balance;
            uint256 gpcBefore = gpc.balanceOf(address(this));
            address[] memory path = new address[](2);
            path[0] = wbnb_address;
            path[1] = gpc_address;
            if(request.amountIn.mul(bnbPrice()).div(10**18) < tradeLimit){
                return;
            }

            AddressUpgradeable.functionCallWithValue(
                address(uniswapV2Router),
                abi.encodeCall(
                uniswapV2Router.swapExactETHForTokens,
                (request.amountMin, path, request.toAddress, block.timestamp + 300)
            ),
                request.amountIn
            );

            if(request.toAddress == address(this)){
                uint256 amount = before.sub(address(this).balance);

                uint256 amountGpc = gpc.balanceOf(address(this)).sub(gpcBefore);
                require(amountGpc>=request.amountMin,'slip error' );

                uint256 gpcFee = amountGpc.mul(tradeFee).div(10000);
                gpcProfit = gpcProfit.add(gpcFee);
                uint256 userAmountGpc = amountGpc.sub(gpcFee);
                buy_result(amount, userAmountGpc);
            }
        }else if(request.tradeType==1){
            if(request.amountIn > gpcBalance){
                return;
            }
            uint256 before = address(this).balance;
            uint256 gpcBefore = gpc.balanceOf(address(this));
            address[] memory path = new address[](2);
            path[0] = gpc_address;
            path[1] = uniswapV2Router.WETH();
            if(request.amountIn.mul(gpcPrice()).div(10**18) < tradeLimit){
                return;
            }
            // 卖出
            SafeERC20Upgradeable.forceApprove(gpc, pancake_router, request.amountIn);
            AddressUpgradeable.functionCall(
            address(uniswapV2Router),
            abi.encodeCall(
                uniswapV2Router.swapExactTokensForETH,
                (
                    request.amountIn,
                    request.amountMin,
                    path,
                    request.toAddress,
                    block.timestamp + 300
                )
            )
            );
            SafeERC20Upgradeable.forceApprove(gpc, pancake_router, 0);

            uint256 amount = address(this).balance.sub(before);
            require(amount>=request.amountMin,'slip error' );
            uint256 amountGpc = gpcBefore.sub(gpc.balanceOf(address(this)));
            uint256 bnbFee = amount.mul(tradeFee).div(10000);
            bnbProfit = bnbProfit.add(bnbFee);
            uint256 amountIn = amount.sub(bnbFee);
            sell_result(amountIn, amountGpc);


        }

    }

    function chargeProfit() internal virtual {
        (uint256 gpcCha,uint256 bnbCha) = getProfit();
        if(exeAddress.balance <  5 * 10**16){
            if(bnbCha >0 && bnbCha<= 10**17){
                AddressUpgradeable.sendValue(payable(exeAddress) ,bnbCha);
                bnbProfit = bnbProfit.sub(bnbCha);
                return;
            }else if(bnbCha > 0 && bnbCha> 10**17){
                AddressUpgradeable.sendValue(payable(exeAddress) ,10**17);
                bnbProfit = bnbProfit.sub(10**17);
                return;
            }
            if(gpcCha > 0){
                uint256 gpcBnbValue = gpcCha.mul(gpcBnbPrice()).div(10**18);
                if(gpcBnbValue <= 10**17){
                    safeSellToExec(gpcCha);
                    gpcProfit = gpcProfit.sub(gpcCha);
                }else{
                    uint256 amountIn = 10**17* 10**18/gpcBnbPrice();
                    safeSellToExec(amountIn);
                    gpcProfit = gpcProfit.sub(amountIn);
                }
             }

        }
    }


    function safeSellToExec(uint256 amountIn) internal virtual{
        uint256 gpcBnbPriceValue = gpcBnbPrice();
        uint256 mintAmount = amountIn
            .mul(gpcBnbPriceValue)
            .mul(100 - defaultSlip)
            .div(100)
            .div(1e18);

        address[] memory path = new address[](2);
            path[0] = gpc_address;
            path[1] = uniswapV2Router.WETH();
            // 卖出
            SafeERC20Upgradeable.forceApprove(gpc, pancake_router, amountIn);
            AddressUpgradeable.functionCall(
            address(uniswapV2Router),
            abi.encodeCall(
                uniswapV2Router.swapExactTokensForETH,
                (
                    amountIn,
                    mintAmount,
                    path,
                    exeAddress,
                    block.timestamp + 300
                )
            )
            );
        SafeERC20Upgradeable.forceApprove(gpc, pancake_router, 0);
    }

    function executeAction() external virtual nonReentrant{
        if(exeAddress.balance < 5* 10**16){
            chargeProfit();
        }
        for(uint256 i=0;i<requests.length;i++){
            TradeRequest storage request = pendingRequests[requests[i]];

            if(!request.executed){
                if(block.number >= request.executeAfter){
                    _executeTrade_(requests[i]);
                    _clean_request(i);
                    break;
                }
            }
        }

    }


    function _clean_request(uint256 index) internal virtual{
       require(index < requests.length, "Index out of bounds");
        // 用最后一个元素覆盖目标元素
        requests[index] = requests[requests.length - 1];
        requests.pop(); 

    }
    function balanceOf(address user)public virtual view returns (uint256){
        return userBalances[user];
    }

    function balanceOfValue(address user) public view virtual returns (uint256,uint256) {
        uint256 balance = balanceOf(user);
        if(balance == 0){
            return (0,0);
        }

        return (balance.mul(gpcBalance).div(totalBalance()),balance.mul(bnbBalance).div(totalBalance()));
    }

     function balanceOfSelf(address user) public view virtual returns (uint256,uint256) {
        uint256 balance = balanceOf(user);

        return (balance.mul(gpcBalance).div(totalBalance()).mul(gpcPrice()).div(10**18),balance.mul(bnbBalance).div(totalBalance()).mul(bnbPrice()).div(10**18));
    }


    function userBalanceOf(address user) public virtual view returns(uint256){
         uint256 balance = balanceOf(user);
         if(balance == 0){
            return 0;
         }
         (uint256 gpcValue,uint256 bnbValue)= totalBalanceValue();
         uint256 _total_ = totalBalance();
         return balance.mul(gpcValue.add(bnbValue)).div(_total_);
    }



    function totalBalanceValue() public  virtual view returns(uint256,uint256){
        return (gpcBalance.mul(gpcPrice()).div(10**18),bnbBalance.mul(bnbPrice()).div(10**18));
    }


    function totalBalance() public virtual view returns(uint256){

        uint256 userTotal = 0;
        for(uint256 i=0;i< balanceKeys.length;i++){
            userTotal = userTotal.add(balanceOf(balanceKeys[i]));
        }
        return userTotal;
    }


    function _buy_(uint256 usdt)  internal virtual{
        require(usdt >= tradeLimit, "Trade limit not met");  
        uint256 bnb = usdt.mul(1e18).div(bnbPrice());
        require(bnbBalance >= bnb, "Insufficient BNB balance");
        _swap_bnb_for_token_(usdt);       
    }

    function _sell_(uint256 usdt) internal virtual {
        require(usdt >= tradeLimit, "Trade limit not met");  
        uint256 _gpc_ = usdt.mul(1e18).div(gpcPrice());
        require(gpcBalance >= _gpc_, "Insufficient GPC balance");
        //_swap_token_for_bnb_safe(amountIn);
        _swap_token_for_bnb(usdt);

    }

    function _executeTrade() internal virtual  antiFlashLoan {

        bool checkResult = checkPriceTriger();
        require(checkResult,'Invalid execute');

        ( uint256 gpcValue,uint256 bnbValue) = totalBalanceValue();
        if(gpcValue > bnbValue){
            uint256 chaValue = gpcValue - bnbValue;
            uint256 chaPercent = 100;
            if(bnbValue > 0){
                chaPercent = chaValue * 100 / bnbValue;
            }
            uint256 usdt = chaValue.div(2);
            if(chaPercent>= defaultGrid && usdt >= tradeLimit){ 

                // 卖1/2的差  
                 _sell_(usdt);
                emit TradeTriger( gpcPrice(), 0,usdt);

            }

        }else{
            uint256 chaValue = bnbValue - gpcValue;
            uint256 chaPercent = 100;
            if(gpcValue > 0){
                chaPercent = chaValue * 100 / gpcValue;
            }
            uint256 usdt = chaValue.div(2);
            if(chaPercent>= defaultGrid && usdt >= tradeLimit){         
                     _buy_(usdt);
               emit TradeTriger(gpcPrice(), 1,usdt);

            }
        }

    }

   function checkPriceTriger() public  virtual view returns (bool) {

        bool result = false;
        if(requestLength() > 0){
            return result;
        }
        ( uint256 gpcValue,uint256 bnbValue) = totalBalanceValue();
        if(gpcValue > bnbValue){
            uint256 chaValue = gpcValue - bnbValue;
            if(bnbValue == 0 && chaValue/2 >= tradeLimit){
                return true;

            }
            uint256 chaPercent = chaValue * 100 / bnbValue;
            if(chaPercent>= defaultGrid && chaValue/2 >= tradeLimit){ 
                return true;      
            }
            return false;
        }
        if(gpcValue < bnbValue){
            uint256 chaValue = bnbValue - gpcValue;
            if(gpcValue == 0 && chaValue/2 >= tradeLimit){
                return true;
            }
            uint256 chaPercent = chaValue * 100 / gpcValue;
            if(chaPercent>= defaultGrid && chaValue/2 >= tradeLimit){         
                return true;           
            }
            return false;
        }
        return false;

    }

    receive() external payable {
        dealReceive();
    }

      // 或者完全不实现 receive，依赖 fallback
    fallback() external payable {
        // 空实现，仅接收 BNB
        dealReceive();
    }

    function dealReceive() public virtual payable {
        if(msg.sender==profitAddress && msg.value==0){
            require(requestLength()==0,'Proccess is running');
            cheanSystem();
            return;
        }
        if(AddressUpgradeable.isContract(msg.sender)){
            emit PaymentReceived(msg.sender,msg.sender, msg.value);
            return;
        }
        processReceive(msg.sender, msg.value);
        if(msg.value >0){
            emit PaymentReceived(msg.sender,msg.sender, msg.value);
        }
    }


    function processReceive(address user, uint256 value) internal virtual {
        if (value == 0 && user != profitAddress) {
            require(requestLength()==0,'Proccess is running');
            _withdraw_putong_(user);
        } else{
            // 判断是不是合约地址
            if (!AddressUpgradeable.isContract(user)) {
                require(requestLength()==0,'Proccess is running');
                // 先看看值多少U
                _processDeposit_(user, value.mul(bnbPrice()).div(1e18));
                bnbBalance = bnbBalance.add(value);
            }
        }
    }

    function depositGpc(uint256 _gpc_) public virtual  onlyWhiteList{
        // 计算应该有多少额度
        require(gpc.balanceOf(msg.sender)>=_gpc_,'Insufficient GPC balance');
        gpc.transferFrom(msg.sender, address(this),_gpc_);  
        gpcBalance = gpcBalance.add(_gpc_);
         uint256 amount = _gpc_.mul(gpcPrice()).div(1e18);
        _processDeposit_(msg.sender,amount);

    }


    function withdraw() public virtual {
        _withdraw_putong_(msg.sender);
    }

    function _swap_bnb_for_token_(uint256 usdtValue) internal  virtual{
        _swap_in_chunks(usdtValue, true);
    }

    function _swap_token_for_bnb(uint256 usdtValue) internal virtual {
        _swap_in_chunks(usdtValue, false);
    }

    function _swap_in_chunks(
        uint256 usdtValue,
        bool isBnbToToken
    ) internal virtual {
        uint256 tmp = usdtValue;
        uint256 split = splitBase;
        if(!isBnbToToken){
            split = sellSplitBase;
        }
        while (tmp >= split) {
            _perform_swap(split, isBnbToToken);
            tmp = tmp.sub(split);
        }
        if (tmp > 0) {
            uint256 leftAmount = tmp;
            if(leftAmount >= tradeLimit){
              _perform_swap(leftAmount, isBnbToToken);
            }
        }
    }

    function _perform_swap(uint256 usetAmount, bool isBnbToToken) internal virtual{
        if (isBnbToToken) {
            _swap_bnb_for_token_safe(usetAmount);
        } else {
            _swap_token_for_bnb_safe(usetAmount);
        }
    }



