    ) internal  virtual {
        uint256 gpcPriceValue = gpcPrice();
        uint256 bnbPriceValue = bnbPrice();
        uint256 minAmount = usdtAmount
            .mul(1e18)
            .div(gpcPriceValue)
            .mul(100 - defaultSlip)
            .div(100); 
        nonce +=1;
        uint256 amountIn = usdtAmount.mul(1e18).div(bnbPriceValue);

        // 4. 设置随机执行延迟
        uint256 delayBlocks = _randomDelay();
        uint256 executeAfter = block.number + delayBlocks;
        bytes32 requestHash = keccak256(abi.encode(nonce,amountIn, minAmount,delayBlocks,executeAfter, block.timestamp));

        pendingRequests[requestHash] = TradeRequest({
            amountIn: amountIn,
            toAddress: address(this),
            amountMin: minAmount ,
            price: gpcPriceValue,
            tradeType:0,
            submitBlock: block.number,
            executeAfter: executeAfter,
            executed: false
        });
        requests.push(requestHash);
        emit RequestSubmitted(requestHash, executeAfter);


    }

